import React from 'react';
import './index.css';
import FlashOnIcon from '@material-ui/icons/FlashOn';

const Header=()=>{
    return (
        <React.Fragment>
            <img src={FlashOnIcon} alt='logo' width='70' height='50' />
        </React.Fragment>
    )


}

export default Header;
